import React from "react";

function Food({ fav }) {
  return <h3>I like {fav}</h3>
}

const foodUserSelect = [
  {
    name: "Beef",
    image: "data:image/jpeg;base64,"
  },
  {
    name: "Pork",
    image: ""
  },
  {
    name: "Chicken",
    image: ""
  },
  {
    name: "Lamb",
    image: ""
  },
  {
    name: "Sausage",
    image: ""
  }
];

function App() {
  return (
    <div>
      <h3>Hello</h3>
      <Food fav="beef" />
      <Food fav="pork" />
      <Food fav="chicken" />
    </div>
  );
}

export default App;
